import { StyleSheet } from 'react-native';
import { Platform } from 'react-native-web';

const styles = StyleSheet.create({
    viewContainer: {
      flex: 1,
      width: Platform.OS === 'ios' || Platform.OS === 'android' ? '100%' : '50%',
      backgroundColor: 'red',
      alignItems: 'center',
      justifyContent: 'center',
      marginTop: '-10%'

    },
  });

export default styles
